import React from "react";

export default function LogoApp({ className }) {
  return (
    <img
      className={className}
      alt="logo"
      src="https://res.cloudinary.com/dhd9jgrw3/image/upload/v1586515096/drivers/logo/logo-drivers-red_gbk3gt.png"
    />
  );
}
